  //const axios = require('axios').default;
  const [query, setQuery] = useState("");
  const [list, setList] = useState([]);
  return (
    <div className="App">
      <h1>MovieFind</h1>
      <h2>Find the perfect movie for you!</h2>
      <SearchBar list = {list} setList = {setList} query = {query} setQuery={setQuery}/>
    </div>
  );

}

export default App;
